const Hello = (props) => {
  console.log(props)
  return (
    <p>Hello {props.name}, you are {props.age} years old!</p>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="Jesse" age={20 + 2} />
      <Hello name="Victoria" age={22} />
      <Hello name = "Jesse again!" />
    </div>
  )
}

export default App;
